INSERT INTO `dish` VALUES (1,'Bobotie','2016-05-26 00:00:00',0,4,'Set the oven at 160°C (325°F). Butter a large casserole. Heat butter and oil in a saucepan and fry the onion and garlic until translucent. Stir in the curry powder and turmeric, and cook briefly until fragrant. Remove the pot from the heat.\nMix in the minced meat. Mix together the crumbs, milk, lemon rind and juice, egg, salt, pepper, apricots, apple, sultanas (golden raisins) and almonds and mix in. Pile into the casserole and level the top. Roll up the leaves and bury them at regular intervals. Seal with foil and bake for 1 1/4 hours. Increase the oven temperature to 200°C (400°F). Mix together the topping milk, eggs and salt (you may require extra topping if you\'ve used a very large casserole), pour over and bake uncovered for a further 15 minutes until cooked and lightly browned. Serve with Yellow Rice and Blatjang.','PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\0u\0\0\0R\\0\0\0gAMA\0\0|Q\0\0\nXiCCPICC Profile\0\0HPY\_wO!ÐsNHCa!Ð1+\n0$\\0\\ZQL r.@E\\Z9p\\w\\~ݯ_\\\0Pΰ\$XdA(\˕$2\8 (\0ر9B@?|\0\]\^=\\J\\0\nD9\IF\\(\r\0(\]iB \[g7\\3\\'	\rvC\0\\0 w>#\C{\Q6p\0(9l.\\(&\'\BucԇO=czټ{o\"SI\\ug%\'\\C\n- i\\\\Z\\}\Y\\\n\B\Y8`\D\\\\ā\xO\BO\<҃\\95#\\su_\y槱\wap\bf\f4\\Z2X!\\\\\_sm\@߽V\0lQ\ck\0p\\0\\\[t\wp.ʘ0, q \^t0\8\@(+\0ăd `\r\@\	Rp\\8yp\\@~0^q0	!\CT\Cd\0CL\`(x\0J\@**\Z\g\tuChz}K\ʰ6l3a\\<8΁s\\p	\\	\\->\\':!L\\r	@8DCbGZ\.ҏ!18\r\a\1ޘ0Y)Ĕb1v\]\\0fK\*a\rvXv	\\\aǰgWC\IG\\\lp޸H\\n5w\0׀k\u\qx<^ow\\4|~?8?@ T	\OBA@\D(&\.zÄiQhG r\\ģ\\\q$I\!9BI	R=\*L&m\Ad>y||<@H\S\(\(\\*J+\\Jզ:Si\\\\Z\\3\1K+^LQG\8Q\\K\E|xxi;\cD	m	7	\:2s4I3\\0\d\B\Z\#Rx)m))T\+R4AsqhiGiWiC\8iitt	\N\q)Kp,22tMgѓ\;\\\de]dce\\\\N\)\9\\\\\5\ݗ$ϐO\%\$TpP\\"G1_\c%XI_)Xi\\J\*\^\B\\W\T\*\*	*{T.\TU{T/d\0\\IF;c\\MI\[-]BSmZ]G=L}zS\rS#NcFƸ\\Z\:\\ZD-V\>)m\\-\M\#:r:,:>]nn\==S/Q\^>o_\\066\0\6\\Z\\Z\n+